import "./css/style.css"

function Header(){
  return(
    <header>
        <h1>簡易イベント表示</h1>
    </header>
  );
}

function Event(){
  const title = "鼓童ワン・アース・ツアー 童";
  return(
    <div className="event_block">
      <div className="date">
        <span>11</span>
        <span>/</span>
        <span>4</span>
      </div>{/* date */}
      <div className="time">
        <dl>
          <dt>open</dt>
          <dd>16:30</dd>
        </dl>
        <dl>
          <dt>start</dt>
          <dd>18:30</dd>
        </dl>
      </div>{/* date */}
      <div className="title">
        <h2><span>{title}</span></h2>
      </div>{/* title */}
      <div className="place">
        <p><span>新潟県民会館</span></p>
      </div>{/* place */}
    </div>
  );
}

function Main(){
  return(
    <main>
      <section className="event_section">
        <div className="main_width">
          <div className="event_group">
            <Event />
            <Event />
            <Event />
            <Event />
          </div>{/* event_group */}
        </div>{/* main_width */}
      </section>
    </main>
  );
}



function App() {
  return (
    <div>
      <Header />
      <Main />

    </div>
  );
}

export default App;
